CREATE TABLE `t_huawei_daily` (
                                  `id` int(11) NOT NULL AUTO_INCREMENT,
                                  `date_id` bigint(24) DEFAULT NULL,
                                  `age` varchar(64) DEFAULT NULL,
                                  `basalMetabolism` varchar(32) DEFAULT NULL,
                                  `bmi` varchar(16) DEFAULT NULL,
                                  `bodyAge` varchar(255) DEFAULT NULL,
                                  `bodyFatRate` varchar(64) DEFAULT NULL,
                                  `bodyScore` varchar(64) DEFAULT NULL,
                                  `bodyWeight` varchar(64) DEFAULT NULL,
                                  `boneSalt` varchar(32) DEFAULT NULL,
                                  `create_time` varchar(32) DEFAULT NULL,
                                  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7479 DEFAULT CHARSET=utf8;
